import React from 'react';

function navbar () {
    return (
        <nav>
            <img src="./assets/images/step-3.svg" alt="" />
            <ul>
                <li>Home</li>
                <li>About Us</li>
                <li>Book Appointment</li>
                <li>Login</li>
            </ul>
        </nav>
    )
}

export default navbar;
